(70, 'Half-Life', NULL, 1447890508, 9.99, '1998-11-08', 'Nombrado juego del año por más de 50 publicaciones, la ópera prima de Valve mezcla acción y aventuras con una tecnología galardonada con varios premios, en un mundo terriblemente realista en el que los jugadores deberán esforzarse por sobrevivir.', 'Valve', 5636970),
