(100, 'Counter-Strike: Condition Zero Deleted Scenes', NULL, 1447889920, 9.99, '2004-03-01', 'Esta versión de Counter-Strike trae una extensa campaña Tour of Duty, un número casi ilimitado de escaramuzas, actualizaciones y nuevos contenidos para la modalidad multijugador, que ya ha recibido varios premios. Además, disfrutarás de más de 12 misiones para un solo jugador de regalo.', 'Valve', 9943003),
